import React, { useEffect, useState } from "react";

const PaperBin = () => {
  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    const savedTasks = JSON.parse(localStorage.getItem("notes"));
    if (savedTasks) setTasks(savedTasks);
  }, []);

  return <></>;
};

export default PaperBin;
